		public function records($records){

			if(Process_Records_Helper::$running && get_class($this) !== 'Process_Sub_Routine') return $this->process_sub($records);
			
			$this->records = $records;

			if(is_object($this->records) && get_class($this->records) == 'ORM_Wrapper'){
				$this->records = $this->records->to_array();
			}
			
			$this->total_records 	= count($this->records);
			$this->record_keys 		= array_keys($this->records);
			$this->records 			= array_values($this->records);

			return $this;
		}

		public function run($callback = false){

			\Process_Records_Helper::$running = true;

			//SET THE TIMEZONE
			date_default_timezone_set('America/Los_Angeles');			

			//INITIALIZE IF NEEDED
			if(!Process_Records_Helper::$initialized) $this->init();			
			
			//SET DEFAULTS
			$this->start_time 		= time();
			$this->percent_complete = 0;

			//RENDER THE INITIAL PROGRESS BAR
			$this->render_progress_bar();

			foreach($this->records as $this->current_key => $record){

				//BOMB OUT ON CONNECTON ABORT
				if(connection_aborted()) exit;				

				//RUN THE CALLBACK
				$res = $callback !== false ? $callback($this->record_keys[$this->current_key], $record, $this) : false;	

				//WAIT FOR 20 MILISECONDS
				if((isset($this->last_render_time) && (((microtime(true)*1000)-1000)/1000) > $this->last_render_time) || !isset($this->last_render_time) ){

					//SET THE LAST RENDER 
					$this->last_render_time = microtime(true);

					//RENDER THE PROGRESS BAR
					//$this->render_progress_bar();

					//IF THERE WAS A MESSAGE UPDATE THE MESSAGE ELEMENT
					if($res) $this->render_result_message($res);
				}

				//RENDER THE PROGRESS BAR
				$this->render_progress_bar();

				//INCRIMENT THE RECORDS PROCESSED
				Process_Records_Helper::$records_processed++;
			}

			//RENDER THE FINISH SCRIPTS
			$this->render_finish();	
		}

		public function generate_records_message($calculate = true){

			$this->finish_time = $this->get_eta();
			
			if($this->current_key == 0){

				//GENERATE THE MESSAGE
				$this->percent_complete = 0;

				return ($this->total_records == 1 ? '' : '<b>Records:</b> 1/'.$this->total_records.' (%0)').'<span style="float:right; display:block;"><b>Dur:</b> '.$this->get_duration().'&nbsp;&nbsp;<b>ETA:</b> '.$this->finish_time."</span>";
			}

			if($calculate) $this->calculate_percent();
			
			return '<b>Records:</b> '. ($this->current_key+1).'/'.$this->total_records.' (%'.$this->percent_complete.')'.'<span style="float:right; display:block;"><b>Dur:</b> '.$this->get_duration().'&nbsp;&nbsp; <b>ETA:</b> '.$this->finish_time."</span>";
		}

		public function calculate_percent(){
			$this->percent_complete = floor((((($this->current_key+1)*100)/($this->total_records*100))*100)*100)/100;
			return $this->percent_complete;
		}

		public function render_finish(){

			if(get_class($this) == 'Process_Records_Helper'){
				
				$duration = $this->get_duration();

				$message = \Buffer::start(function() use ($duration) {
					echo 'Finished '.Process_Records_Helper::$records_processed.' records in '.$duration;
				});

				$this->percent_complete = 100;

				$this->render_progress_bar($message);

				//OUTPUT THE MESSAGE WITH JAVASCRIPT
				if($this->should_render()):
					?>
						<script id="update_progress_script">

							if(typeof(handle) != 'undefined' && handle != null){
								clearInterval(handle);
							}				
							
							document.getElementById("progress_records_messages").innerHTML = '<?=$message?>';

							var element = document.getElementById("update_progress_script");
							element.outerHTML = "";

							var x = document.getElementsByClassName('has-spinner');

							if(x.length) for(var y in x) if(typeof(x[y].classList) !== 'undefined') x[y].classList.remove('has-spinner');

							delete element;

						</script>
					<?
				endif;

				Process_Records_Helper::$sub_routines = [];
				$this->records = null;
				Process_Records_Helper::$records_processed = 0;
				Process_Records_Helper::$running = false;
			}
			else{
				if($this->should_render()):
					?>
						<script id="finish_sub_routine_script_<?=$this->id?>">

							if(typeof(handle_<?=$this->id?>) != 'undefined' && handle_<?=$this->id?> != null){
								clearInterval(handle_<?=$this->id?>);
							}

							document.getElementById("sub_routine_<?=$this->id?>").remove();

							var element = document.getElementById("finish_sub_routine_script_<?=$this->id?>");
							element.outerHTML = "";
							delete element;

						</script>
					<?
				endif;

				Process_Records_Helper::$sub_routines[$this->id] = null;
				$this->records = null;
				$this->parent = null;

			}
		}

		public function render_progress_bar($message = false){
			
			$message 			= !$message ? $this->generate_records_message() : $message;
			$message 			= addslashes($message);
			$script_id 			= 'update_progress_script';
			$progress_messsages = 'progress_records_messages';
			$progress_bar 		= 'progress-bar';

			if(get_class($this) == 'Process_Sub_Routine'){
				$script_id 			.= '-'.$this->id;
				$progress_messsages .= '-'.$this->id;
				$progress_bar 		.= '-'.$this->id;
			}

			//OUTPUT THE MESSAGE WITH JAVASCRIPT
			if($this->should_render()):
			?>
				<script id="<?=$script_id?>">					
					document.getElementById("<?=$progress_messsages?>").innerHTML = '<?=$message?>';
					document.getElementById('<?=$progress_bar?>').style.width = '<?=$this->percent_complete?>%';

					var element = document.getElementById("<?=$script_id?>");
					element.outerHTML = "";
					delete element;

				</script>
			<?
			endif;

			if(get_class($this) == 'Process_Sub_Routine'){
				$parent_total 					= $this->parent->total_records;
				$parent_current 				= $this->parent->current_key+1;
				$parent_percent 				= floor((((($this->parent->current_key)*100)/($this->parent->total_records*100))*100) * 100) / 100;
				$new_percent 					= $parent_percent+(floor(($this->percent_complete/$parent_total)*100)/100);
				$this->parent->percent_complete = $new_percent;
				$this->parent->render_progress_bar($this->parent->generate_records_message(false));
			}
		}

		public function render_result_message($message){

			$message 			= is_string($message) ? addslashes($message) : '';
			$script_id 			= 'update_message_script';
			$message_wrapper 	= 'message_wrapper';

			if(get_class($this) == 'Process_Sub_Routine'){
				$script_id 			.= '-'.$this->id;
				$message_wrapper	.= '-'.$this->id;
			}
			if($this->should_render()):
				?>
					<script id="<?=$script_id?>">
						document.getElementById("<?=$message_wrapper?>").innerHTML = '<?=$message?>';
						var element = document.getElementById("<?=$script_id?>");
						element.outerHTML = "";
						delete element;
					</script>
				<?
			endif;
		}

		//ESTIMATE THE ETA
		public function get_eta(){
			$est = $this->start_time+(((time()-$this->start_time)/($this->current_key+1))*$this->total_records);
			$human_time = human_time($est, 'ymdhis');
			return date('g:i a', $est). ($human_time !== '' ? ' ('.$human_time.')' : '');
		}

		public function get_duration(){

			$res = human_time($this->start_time, 'ymdhis');

			return strlen($res) ? $res : '1s';
		}

		public function render_message($message){

			$message 			= addslashes($message);
			$script_id 			= 'update_progress_script';
			$progress_messsages = 'progress_records_messages';
			$message_wrapper 	= 'message_wrapper';
			$progress_bar 		= 'progress-bar';
			$append 			= '';

			if(get_class($this) == 'Process_Sub_Routine'){
				$script_id 			.= '-'.$this->id;
				$progress_messsages .= '-'.$this->id;
				$progress_bar 		.= '-'.$this->id;
				$message_wrapper 	.= '-'.$this->id;
				$append 			= '_'.$this->id;
			}

			//OUTPUT THE MESSAGE WITH JAVASCRIPT
			if($this->should_render()):
			?>

				<script id="update_progress_script_new">

					var element = document.getElementById("<?=$script_id?>");

					if(typeof(element) != 'undefined' && element != null){
						element.outerHTML = "";
						delete element;
					}

					document.getElementById("update_progress_script_new").id = '<?=$script_id?>';
					document.getElementById("<?=$message_wrapper?>").innerHTML = '<?=$message?>';
					

				</script>
			<?
			endif;

		}

		public function process_sub($records){
			$id = count($this->sub_routines)+1;
			$sub = new Process_Sub_Routine;
			$sub->set_parent($this)->set_id($id)->records($records);
			$this->sub_routines[$id] = $sub;
			if($this->should_render()):
				?>
					<script id="render_sub_process_script">
						var sub_routine_wrapper = document.createElement('div');
						sub_routine_wrapper.id 	= 'sub_routine_<?=$id?>';
						sub_routine_wrapper.classList.add('sub_routine_item');

						sub_routine_wrapper.innerHTML = 
							'<div id="process_records_wrapper-<?=$id?>">'+
								'<div id="progress_records_messages-<?=$id?>"></div>'+
								'<div class="progress">'+
									'<div id="progress-bar-<?=$id?>" class="progress-bar progress-bar-striped progress-bar-info" style="width:0%"></div>'+
								'</div>'+
							'</div>'+
							'<div id="message_wrapper-<?=$id?>"></div>'
						;

						document.getElementById('sub_routine_wrapper').appendChild(sub_routine_wrapper);

						var element = document.getElementById("render_sub_process_script");
						element.outerHTML = "";
						delete element;

					</script>

				<?
			endif;

			return $sub;
		}

		public function rendering($val = true){

			if($val === true && isset($_SERVER['REMOTE_ADDR'])){

				//TURN ON RENDERING
				Process_Records_Helper::$render = true;
				
				//DO NOT IGNORE USER ABORTS
				ignore_user_abort(false);
			}
			else{
				
				//TURN OFF RENDERING
				Process_Records_Helper::$render = false;

				//IGNORE USER ABORTS
				ignore_user_abort(true);
			}
			
			return $this;
		}

		public function should_render(){
			
			if(is_null(Process_Records_Helper::$render)){

				//TOGGLE RENDERING
				isset($_SERVER['REMOTE_ADDR']) ? $this->rendering(true) : $this->rendering(false);
			}

			return Process_Records_Helper::$render;
		}
	}

	class Process_Sub_Routine extends Process_Records_Helper {

		public $records;
		public $id;
		public $parent;

		public function __construct(){

		}

		public function set_parent($parent){
			$this->parent = $parent;
			return $this;
		}

		public function set_id($id){
			$this->id = $id;
			return $this;
		}

	}
